package com.js.springmvc2;

public class Data2 {

	private int price;
	private int count;
	
	public Data2() {
		// TODO Auto-generated constructor stub
	}

	public Data2(int price, int count) {
		super();
		this.price = price;
		this.count = count;
	}

	public int getPrice() {
		return price;
	}

	public void setPrice(int price) {
		this.price = price;
	}

	public int getCount() {
		return count;
	}

	public void setCount(int count) {
		this.count = count;
	}
	
}
